import React , {useState} from 'react'
import logo from './assets/Mlogo.png'
import './Header.css';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeIcon from '@material-ui/icons/Home';
import CloudDownloadIcon from '@material-ui/icons/CloudDownload';
import PersonIcon from '@material-ui/icons/Person';
import IconButon from '@material-ui/core/IconButton';

const Header = () => {
    const useStyles = makeStyles({
        body: {
            backgroundColor: theme.palette.common.white,
          },
        root: {
          width: 200,
        },
        label: {
            color: "red"
        }
      });
    const classes = useStyles();
    const [value, setValue] = React.useState('recents');

    const handleChange = (event, newValue) => {
     setValue(newValue);
    };

    return (
        <div>
        <div className="header">
            <div>
            <IconButon>
            <img 
            className="header__logo"
            src={logo}
            alt='portfolio logo'
            /> 
            </IconButon>
            </div>
            <div className="header__menu">
                <BottomNavigation  value={value} onChange={handleChange} className={classes.root}>
                <BottomNavigationAction label="Home" value="home" icon={<HomeIcon fontSize="large"/>} />
                <BottomNavigationAction label="About" value="about" icon={<PersonIcon fontSize="large"/>} />
                <BottomNavigationAction label="Resume" value="resume" icon={<CloudDownloadIcon fontSize="large"/>} />
                </BottomNavigation>
            </div>
        </div>
        </div>

    )
}

export default Header
